for ip in html:
    ip_com = re.compile('''<td class="kbnDocTableCell__dataField eui-textBreakAll eui-textBreakWord" data-test-subj="docTableField"><div class="truncate-by-height">(\d+\.\d+\.\d+\.\d+)''')
    ip_find = ip_com.findall(ip)
    for i in ip_find:
        # 目标URL
        url = "https://bgp.he.net/ip/" + i

        # 发起请求
        response = requests.get(url)

        # 检查请求是否成功
        if response.status_code == 200:
            # 使用PyQuery解析网页内容
            doc = pq(response.text)
            rows = doc('tbody tr')
            for row in rows.items():
                # print(row)
                as_elm = row.find('a').eq(0)
                ip_elm = row.find('td').eq(1)
                desc_elm = row.find('td').eq(2)
                if as_elm:
                    as1 = as_elm.attr('href').lstrip('/')
                    # print(as1.lstrip('/'))
                if ip_elm:
                    ip = ip_elm.text()
                    #print(ip)
                if desc_elm:
                    desc = desc_elm.text()
                    #print(desc)
        else:
            print(f"Failed to retrieve the webpage. Status code: {response.status_code}")

        url = "https://bgp.he.net/" + as1
